import { useRoutes } from "react-router-dom";
import { lazy,useContext,useState} from "react";
import { Navigate } from "react-router-dom";
import { USER_TYPES,USER,use } from '../constants';

const Profil= lazy(() => import("../views/profils/profils.js"));
const Etud= lazy(() => import("../views/profils/etud.js"));
const Event= lazy(() => import("../views/event.js"));
const Index= lazy(() => import("../views/Index.js"));
const Prof= lazy(() => import("../views/profils/prof.js"));
const Sujet= lazy(() => import("../views/USER/STUDENT/sujets/sujets.js"));
const Reunion= lazy(() => import("../views/USER/PROF/reunions/reunion.js"));
const Online= lazy(() => import("../views/USER/PROF/reunions/online.js"));
const Presentiel= lazy(() => import("../views/USER/PROF//reunions/presentiel.js"));
const Sujetpcd= lazy(() => import("../views/USER/STUDENT/sujets/sujet_pcd.js"));
const Sujetpfe= lazy(() => import("../views/USER/STUDENT/sujets/sujet_pfe.js"));
const Sujetpe= lazy(() => import("../views/USER/STUDENT/sujets/sujet_pe.js"));
const Face= lazy(() => import("../views/face.js"));

const Result= lazy(() => import("../views/USER/STUDENT//result/result.js"));






export default function Router(){
  const [value,setValue]=useState(USER)
  let ThemeRoutes = useRoutes([



      { path: "/",
      element: <Index /> ,

      },
      { path: "/profil",
      element: <Profil /> ,

      },
      { path: "/prof",
      element: <Prof />,

      },
      { path: "/etud",
      element: <Etud /> ,

      },
      { path: "/sujet",
      element: <Studentuser><Sujet></Sujet></Studentuser> ,

      },
      { path: "/sujet_pcd",
      element: <Studentuser><Sujetpcd /></Studentuser> ,

      },
      { path: "/result",
      element: <Studentuser><Result /></Studentuser> ,

      },
      { path: "/reunion",
      element: <Profuser><Reunion /></Profuser> ,

      },
      { path: "/event",
      element: <Publicuser><Event /> </Publicuser>,

      },
      { path: "/login",
      element: <Face /> ,

      },

    ]);


return (
  <use.Provider value={{value,setValue}}>
    {ThemeRoutes}
  </use.Provider>
);}


function Profuser({ children }) {
  const { value, setValue } = useContext(use);

  if (value === USER_TYPES.PROF) {
    return (
      <>
        {children}
      </>
    );
  } else {
    return <Navigate to={"/"} />;
  }
}
function Studentuser({ children }) {
  const { value, setValue } = useContext(use);
  if (value === USER_TYPES.STUDENT) {
    return (
      <>
        {children}
      </>
    );
  } else {
    return <Navigate to={"/"} />;
  }
}
function Publicuser({ children }) {
  const { value, setValue } = useContext(use);
  if (!(value === USER_TYPES.UNKWNON)) {
    return (
      <>
        {children}
      </>
    );
  } else {
    return <Navigate to={"/"} />;
  }
}
